script: |
  super -f text -I q11803.spq | sort > q11803.out

inputs:
  - name: q11803.spq
    data: |
      SELECT - ( + ( ( + ( 40 ) ) ) ) AS col2 FROM tab1 (FORMAT parquet) WHERE NOT ( col1 * col0 ) <= ( 29 * - 10 );
  - name: tab1

outputs:
  - name: q11803.out
    data: |
      -40
      -40
      -40
